odes and location names in the legend\n","LocationSentiment <- ggplot(McSentimentLocation, aes(x = as.factor(location_code), y = score, fill = as.factor(location_code))) +\n","  geom_bar(stat = \"identity\", position = \"stack\", color = \"black\") +\n","  scale_fill_manual(values = rainbow(length(unique(McSentimentLocation$truncated_address))),\n","                    breaks = unique(McSentimentLocation$location_code),\n","                    labels = code_location_mapping$combined_label) +\n","  theme_minimal() +\n","  labs(title = \"Sentiment Scores for McDonald's Store Locations (US)\",\n","       x = \"Location Code\",  # Modify x-axis label\n","       y = \"Sentiment Score\") +\n","  theme(axis.text.x = element_text(angle = 60, hjust = 1),\n","        axis.title.x = element_text(size = 10))\n","\n","LocationSentiment\n","ggsave(\"LocationSentiment.png\", plot = LocationSentiment)  \n"]},{"cell_type":"code","execution_count":null,"id":"e891d198","metadata":{"papermill":{"duration":0.027731,"end_time":"2023-12-26T20:16:16.788578","exception":false,"start_time":"2023-12-26T20:16:16.760847","status":"completed"},"tags":[]},"outputs":[],"source":[]},{"cell_type":"markdown","id":"f9cf19fd","metadata":{"papermill":{"duration":0.029512,"end_time":"2023-12-26T20:16:16.846143","exception":false,"start_time":"2023-12-26T20:16:16.816631","status":"completed"},"tags":[]},"source":["# 8 - Plotting the sentiment scores in the map"]},{"cell_type":"code","execution_count":17,"id":"e0eedd2c","metadata":{"execution":{"iopub.execute_input":"2023-12-26T20:16:16.90625Z","iopub.status.busy":"2023-12-26T20:16:16.904376Z","iopub.status.idle":"2023-12-26T20:16:17.938393Z","shell.execute_reply":"2023-12-26T20:16:17.935961Z"},"papermill":{"duration":1.068506,"end_time":"2023-12-26T20:16:17.941988","exception":false,"start_time":"2023-12-26T20:16:16.873482","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Warning message:\n","“\u001b[1m\u001b[22